import React from 'react';
import './_Quotes.scss';

const Quotes = () => {
    return (
    <> 
    <section className="quote">
      <div className="quote--wrapper">
          <h2 className="quote__title">Connect with us on social media</h2>
          <p className="quote__content">Connect with us on social media</p>
          <p className="quote__author">Connect with us on social media</p>
      </div>
    </section>
    </>
    )
}

export default Quotes
